`,a(e.p,{children:"Hey, have you ever worked super hard on something, thinking it\u2019s going to be amazing, only to see it flop? And then something you did casually\u2014like a random joke or a quick doodle\u2014turns out to be a huge success? It\u2019s frustrating, right? Why does this even happen?"}),`
`,a(e.hr,{}),`
`,a(e.h3,{id:"lets-talk-about-those-surprise-wins",children:"Let\u2019s talk about those surprise wins"}),`
`,a(e.p,{children:["Sometimes, we try so hard to make things perfect, and they still don\u2019t work. But the stuff we do without overthinking? That\u2019s what often surprises us and takes off. Like when a ",a(e.strong,{children:"random cat video"})," or ",a(e.strong,{children:"Reels/TikTok"})," you barely thought about goes viral."]}),`
`,a(e.p,{children:"Feels unfair, doesn\u2019t it?"}),`
`,a(e.hr,{}),`
`,a(e.h3,{id:"so-i-was-talking-to-my-friend-about-this",children:"So I was talking to my friend about this\u2026"}),`
`,a(e.p,{children:["I was talking to my friend ",a(e.a,{href:"https://x.com/iamwaseem99",children:"Waseem"})," about this, and he mentioned a book \u2192 ",a(e.a,{href:"https://www.amazon.in/Why-Greatness-Cannot-Planned-Objective/dp/3319155237",children:"Why Greatness Cannot Be Planned"}),"."]}),`
`,a(e.p,{children:"I haven\u2019t read it myself but got a quick gist from Good Reads."}),`
`,a(e.p,{children:"The whole idea is that true greatness doesn\u2019t come from obsessing over plans. It comes when we follow our curiosity and just do what feels right in the moment."}),`
`,a(e.hr,{}),`
`,a(e.h3,{id:"cool-stuff-that-happened-by-accident",children:"Cool stuff that happened by accident"}),`
`,a(e.p,{children:["Let me tell you about a few real-life examples where things became ",a(e.strong,{children:"great"})," by accident:"]}),`
`,a(e.ul,{children:[`
`,a(e.li,{children:["A guy working on radar experiments noticed a candy bar melted in his pocket. That\u2019s how the ",a(e.strong,{children:"microwave oven"})," was born."]}),`
`,a(e.li,{children:["A scientist found mold in a petri dish that killed bacteria\u2014and boom, we got ",a(e.strong,{children:"penicillin"}),"."]}),`
`]}),`
`,a(e.p,{children:"These weren\u2019t carefully planned breakthroughs. They happened because someone noticed something unexpected and leaned into it."}),`
`,a(e.hr,{}),`
`,a(e.h3,{id:"heres-what-i-think-about-all-this",children:"Here\u2019s what I think about all this"}),`
`,a(e.p,{children:"Look, I\u2019m not saying you should just sit around waiting for good stuff to happen. That\u2019s not the point at all."}),`
`,a(e.p,{children:"You still gotta put in the work - that\u2019s just how things get done."}),`
`,a(e.p,{children:"But here\u2019s what I\u2019ve learned:"}),`
`,a(e.ul,{children:[`
`,a(e.li,{children:"Don\u2019t get so wrapped up in following some strict plan"}),`
`,a(e.li,{children:"Keep your eyes open for happy accidents"}),`
`,a(e.li,{children:"Take little breaks"}),`
`,a(e.li,{children:"Let your mind just do its thing"}),`
`,a(e.li,{children:"Follow what interests you"}),`
`]}),`
`,a(e.p,{children:"That\u2019s usually when the cool stuff happens."}),`
`,a(e.p,{children:"So look, next time you do something, don\u2019t stress about making it perfect. I\u2019ve noticed my best ideas usually show up when I\u2019m just relaxing and going with the flow."}),`
