`,a(e.p,{children:"I\u2019m a builder. Always have been. Started at 18. Self-taught dev. Learn by doing."}),`
`,a(e.p,{children:"First, iOS. No iPhone though. Switched to Android."}),`
`,a(e.p,{children:["Found ",a(e.a,{href:"https://appinventor.mit.edu",children:"MIT App Inventor"}),". Drag-and-drop stuff. Got bored. Moved to Android Studio."]}),`
`,a(e.p,{children:"No mentor. Skipped class. Stayed late. 21km commute home."}),`
`,a(e.p,{children:"Loved every minute."}),`
`,a(e.p,{children:"Watched tutorials. Tried new things. Tweaked code. Made it work."}),`
`,a(e.p,{children:"Got good at coding. Design sucked though. So I learned that too."}),`
`,a(e.p,{children:"Already knew art. Painting, sketching. Helped a bit."}),`
`,a(e.p,{children:"Copied Dribbble designs. Daily practice. Got decent after a few months."}),`
`,a(e.p,{children:"Joined open source. Learned tons from bright minds."}),`
`,a(e.p,{children:"Started YouTube. Reduced my inferiority complex. Made mistakes. Got traction."}),`
`,a(e.p,{children:["Founded a ",a(e.a,{href:"https://github.com/TheCodeMonks",children:"dev community"}),". Learned from others experiences."]}),`
`,a(e.p,{children:"Got design jobs. Improved products from scratch."}),`
`,a(e.p,{children:"Worked at companies. Gained experience. Got bored. Quit."}),`
`,a(e.p,{children:["Started my own ",a(e.a,{href:"https://thisux.com",children:"ThisUX \u2013 Design Led Product studio"}),". Tough at first. Got better."]}),`
`,a(e.p,{children:["Became full-stack. Tried all frameworks. Fell in love with ",a(e.a,{href:"svelte.dev",children:"Svelte/Kit"}),"."]}),`
`,a(e.p,{children:"Built client products. Made my own too. Always top-notch design."}),`
`,a(e.p,{children:"Still build side projects. For fun. Keeps me curious."}),`
`,a(e.p,{children:"It\u2019s not wasting time. It\u2019s connecting dots."}),`
`,a(e.p,{children:"You become what you consume. I believe that."}),`
`,a(e.p,{children:"Building keeps me proactive. Gets things done."}),`
`,a(e.p,{children:"Won\u2019t stop. Build. Share. Do it forever."}),`
`,a(e.p,{children:"That\u2019s the power of building. It\u2019s not just about the product. It\u2019s about you."}),`
`,a(e.h2,{id:"few-things-ive-learned",children:"Few things I\u2019ve learned:"}),`
`,a(e.ul,{children:[`
`,a(e.li,{children:[a(e.strong,{children:"Ok to failure."})," First hackathon? Dead last. Next one? First place."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Collaborate."})," Solo for years. Joined a team. Mind-blowing growth."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Document everything."})," Future you will thank you. Trust me."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Sleep on it."})," Stuck on a bug for hours. Slept. Solved it at breakfast."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Take breaks."})," Coded 16 hours straight. Burned out. Now? Regular walks. Better code."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Read the docs."})," Struggled with an API. RTFM saved days of work."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Give back."})," Answered StackOverflow questions. Learned more than I taught."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Version control."})," Lost a week\u2019s work once. Now? ",a(e.a,{href:"https://github.com/Spikeysanju",children:"Git"})," is my best friend."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Accessibility matters."})," Made apps for everyone. Opened new markets."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Design with care."})," First app? Ugly as hell. Now? Pixel-perfect every time."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Build Templates."})," Repeated code? Made a template. Saved hours."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Invest in tools."})," Bought a Mac. Design improved. Bought a new monitor. Productivity doubled. Bought a new chair. Back pain gone. Invest in yourself."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Follow peers."})," Twitter, GitHub, Reddit. Found new tools, new ideas, new friends."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Ignore community drama."})," Wasted time on Twitter fights. Now? Mute, block, move on."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Say no."})," Overcommitted once. Burned out. Now? Prioritize. Focus on what matters."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Watch people closely."})," Learned from the best. Copied their habits. Got better."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Imitate, then innovate."})," Copied designs. Learned the why. Made my own. Better than before."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Ego is the enemy."})," Thought I was the best. Got humbled. Now? Stay humble. Keep learning."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Appreciate good work."})," Saw a great design? Tweeted about it. Made friends. Learned from them."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Passion needs money."})," Loved building. No money. Burned out. Now? Charge what I\u2019m worth."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Don\u2019t buy domains."})," Bought ~65 domains. Never used them. Now? Buy only when needed. (bit personal haha)"]}),`
`,a(e.li,{children:[a(e.strong,{children:"Reddit is a goldmine."})," Found clients, friends, tools. Always learning. (Read the comments too)"]}),`
`,a(e.li,{children:[a(e.strong,{children:"Bringing traffic to your site is easy."})," Built a site. No visitors. Now? share on Reddit, Twitter, HackerNews. Boom. Traffic spike in hours. (This is a secret sauce)"]}),`
`,a(e.li,{children:[a(e.strong,{children:"Give talks."})," First one? Nervous as hell. Now? Regular speaker. Helps me learn better."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Give feedback."})," First PR? Got roasted. Now? Give constructive feedback. Help others grow."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Security first."})," Got hacked once. Never again. Now it\u2019s built-in from day one."]}),`
`,a(e.li,{children:[a(e.strong,{children:"Optimize later."})," Premature optimization killed my first big project. Now I make it work, then make it fast."]}),`
